css:
.sheet-toolbar {
  border-bottom: none;
  box-shadow: 0 0 0.5px #313236, 0 1px 1.5px #313236, 0 0 3px #313236;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  -webkit-filter: invert(100%);
}
img.content-dark {
  -webkit-filter: invert(100%);
}
img.content-light {
  -webkit-filter: invert(100%);
}
.popover {
  border: 1px solid #313236;
}
.mail-label {
  -webkit-filter: contrast(110%) brightness(85%);
}
.release-bar {
  order: -1;
}
.release-bar-inner {
  height: 25px;
  display: block;
  padding-left: 10px;
  padding-top: 2px;
  color: #ffffff;
  background-color: #00ac6f;
  border-bottom: 1px solid #00794e;
}
.release-bar-inner:hover {
  background-color: #00794e;
  border-bottom: 1px solid #00603e;
  text-decoration: none;
  color: white;
}
.release-bar-inner i {
  margin-right: 8px;
}
